		if err != nil {
			t.Fatal(err)
		}
		rawTx, err := parser.New(rawtx)
		if err != nil {
			t.Fatal(err)
		}
		tx, err := DecodeTx(rawTx)
		if err != nil {
			t.Fatal(err)
		}
		if tx.Segwit != test.segwit {
			t.Errorf("%v: Segwit does not match: %t != %t",
				test.name, tx.Segwit, test.segwit)
		}
		testRawTx := fmt.Sprintf("%x", serial.ReverseHex(serial.DoubleSha256(rawtx)))
		if !test.segwit && testRawTx != test.txhash {
			t.Errorf("%v: Error in tests. Transaction hash does not match: %v != %v",
				test.name, testRawTx, test.txhash)
		}

		txHash := fmt.Sprintf("%x", serial.ReverseHex(tx.Hash))
		if txHash != test.txhash {
			t.Fatalf("%v: Transaction hash does not match: %v != %v",
				test.name, txHash, test.txhash)
		}

		if int(tx.NVin) != test.nvin {
			t.Errorf("Wrong number of inputs: %d != %d", tx.NVin, test.nvin)
		}
		if int(tx.NVout) != len(test.encoded) {
			t.Errorf("Wrong number of output. %d != %d", tx.NVout, len(test.encoded))
		}
		if len(test.addrtype) != len(test.encoded) {
			t.Errorf("Error in tests: %d != %d", len(test.addrtype), len(test.encoded))
		}
		if tx.Locktime != test.locktime {
			t.Errorf("Wrong Locktime %d != %d", tx.Locktime, test.locktime)
		}
		if tx.NVersion != test.version {
			t.Errorf("Wrong Version %d != %d", tx.NVersion, test.version)
		}
		for i, vout := range tx.Vout {
			if vout.AddrType != test.addrtype[i] {
				t.Errorf("%s: Wrong TxType: %x != %x", test.name, vout.AddrType, test.addrtype[i])
			}
			decoded, err := DecodeAddr(vout.AddrType, vout.Addr)
			if err != nil {
				t.Error("DecodeAddr: ", err)
			}
			if test.encoded[i] != decoded {
				t.Errorf("%v: String on decoded value does not match expected value: %v != %v",
					test.name, decoded, test.encoded[i])
			}
		}
